function stringToUint8Array(t){return(new TextEncoder).encode(t)}const fromHexString=t=>Uint8Array.from(t.match(/.{1,2}/g).map(t=>parseInt(t,16)));function concat3(t,n,r){var e=new Uint8Array(t.length+n.length+r.length);return e.set(t),e.set(n,t.length),e.set(r,t.length+n.length),e}const byteHashOfStr=t=>fromHexString(sha3_256(stringToUint8Array(t)));